'use strict';
let ClientMessage = require('./ClientMessage.js');
class ClientMessageBuilder extends ClientMessage {
    setMessageId(messageId) {
        this.messageId = messageId;
    }
    setDateTime(dateTime) {
        this.dateTime = dateTime;
    }
    setFrom(from) {
        this.from = from;
    }
    setMessageType(messageType) {
        this.messageType = messageType;
    }
    setFeature(feature) {
        this.feature = feature;
    }
    setText(text) {
        this.text = text;
    }
    setSubject(subject) {
        this.subject = subject;
    }
    build() {
        return this;
    }
}
module.exports = ClientMessageBuilder
